import React, { useEffect, useState } from 'react';
import './App.css';

type MilkInformation = {
  count: number;
  name: string;
  // temperatureC: number;
}

export default function App() {
  const [milkData, setMilkData] = useState<MilkInformation[]>([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch(" https://localhost:7023/api/milk");
      const MilkResults = await response.json();
      setMilkData(MilkResults);
    }
    getData();
  }, [])

  return(<> milkData.map((m, index) => {
      <>
        <div key={index}>
          <h2>{m.count}</h2>
          <p>{m.name}</p>
        </div>;
      </>
  })</>);
}
